      <tr>
          <th>Email</th>
          <th>Nom d'Utilisateur</th>
          <th>Mot de passe</th>
          <th>Modifier</th>
          <th>Supprimer</th>
      </tr>
      {% for user in users %}
      <tr>
        <td>{{ user.email }}</td>
        <td>{{ user.username }}</td>
         <td>{{ user.password }}</td>
        <td><a href=\"{{ path('admin_update_user', {id: user.id}) }}\">Modifier</a></td>
        <td><a href=\"{{ path('admin_delete_user', {id: user.id}) }}\">Supprimer</a></td>
      </tr>
      {% endfor %}
    </table>
 
 {% endblock %}", "user/admin_read_user.html.twig", "/var/www/html/projets/eLibrairie/eLibrairie/templates/user/admin_read_user.html.twig");
